INSERT INTO `project` (`id`,`organization_id`,`name`,`description`,`address1`,`address2`,`city`,`state`,`country`,`zip`,`remote_flag`,`status`,`created_time`,`updated_time`,`image_url`) VALUES (2,3,'Android app development','At The Sankofa Center we empower people to change lives and foster healthy behaviors to prevent, detect, and treat HIV/AIDS. We do this through utilizing traditional African dance & drama fused with health information to educate people of all ages in Ghana. We are committed to providing free counseling, rapid HIV/AIDS testing and connecting people with HIV/AIDS to local medical resources. We value equipping the next generation with tools to wipe out HIV/AIDS with a compassionate and open-minded ethos. Since 2004 we have educated 35,000 students about HIV prevention, 50,000 community members on HIV transmission, and have provided over 4,000 individuals with free rapid HIV testing ...',NULL,NULL,NULL,NULL,NULL,NULL,'Y','A','2016-03-08 07:14:34','2016-10-26 16:06:11','https://cdn.pixabay.com/photo/2016/09/30/10/33/kermit-1704932__340.jpg');
INSERT INTO `project` (`id`,`organization_id`,`name`,`description`,`address1`,`address2`,`city`,`state`,`country`,`zip`,`remote_flag`,`status`,`created_time`,`updated_time`,`image_url`) VALUES (3,15,'Wordpress web development','\"WordPress website programming and design volunteers wanted for the End Poverty Campaign. You can help improve our http://www.change.net website, already reaching millions of visitors a year. Flexible hours are available.\n\nSKILLS WE SEEK We seek both programmers and theme (web page) designers. WordPress experience is ideal, but experience with other CMSs, HTML, PHP, MySQL and CSS is also very welcome!\n\nIMPORTANT:\nWe require at least a year of experience - and several years for some activities. Except for those with high level, professional skills, we ask most volunteers to average at least 15 hours a week. Some exceptions to these guidelines are possible. You can speak with us about this before ...\"',NULL,NULL,NULL,NULL,NULL,NULL,'Y','A','2016-01-10 07:04:04','2016-11-01 18:32:12','https://cdn.pixabay.com/photo/2016/07/06/06/25/pixabay-1500031__340.jpg');
