INSERT INTO `project` (`id`,`organization_id`,`name`,`description`,`address1`,`address2`,`city`,`state`,`country`,`zip`,`remote_flag`,`status`,`created_time`,`updated_time`,`image_url`) VALUES (6,12,'Needed JAVA coders','We are a good ways into this software project which allows for an embedded poll using approval voting and our branding. It is an open-source software project using Python on Github. We have issues laid out on Github and have an active forum.\n\nIn your application, please include (1) a resume or LinkedIn profile, (2) why you are interested in this project, and (3) indicate whether you would like to be the a lead developer. We will refer you to the forum right after. Thanks for your interest!\n\nopen-source software project using python on Github\"',NULL,NULL,NULL,NULL,NULL,NULL,'Y','A','2016-06-02 16:08:53','2016-09-10 06:41:36','https://cdn.pixabay.com/photo/2015/10/09/09/26/data-978962__340.jpg');
