INSERT INTO `project` (`id`,`organization_id`,`name`,`description`,`address1`,`address2`,`city`,`state`,`country`,`zip`,`remote_flag`,`status`,`created_time`,`updated_time`,`image_url`) VALUES (23,6,'Advance Social Innovation Accounting Leadership Volunteering','Dear Skilled Accounting Volunteers, Advance Social Innovation ( www.AdvanceSocialInnovation.org) has an initiative called CrowdDoing . We are creating virtual volunteer opportunities of people who want to volunteer for 100 hours over the next 6 months who plan to make a 2 hour period available one day a week for most weeks to help social enterprises. This is intended to be service learning for professional skilled accountants, bookeepers, comptrollers, and people with financial planning expertise. This will help social enterprises find a way to their next level through expertise. Expertise is provided by volunteers as an interdisciplinary public service problem solving and creating impact in communities as a consequence. But we need people with a vast variety of talents to seize micro leadership opportunities.',NULL,NULL,NULL,NULL,NULL,NULL,'Y','A','2016-05-19 23:03:45','2016-12-14 04:35:44','https://cdn.pixabay.com/photo/2012/04/16/12/26/computer-35772__340.png');
INSERT INTO `project` (`id`,`organization_id`,`name`,`description`,`address1`,`address2`,`city`,`state`,`country`,`zip`,`remote_flag`,`status`,`created_time`,`updated_time`,`image_url`) VALUES (24,10,'Virtual Volunteer Admin Assistant','\"We are looking for virtual volunteers to help with administrative tasks who can help the organization with his/her administrative skills. We are looking for highly motivated volunteers who are willing to contribute and make a difference.\n\n5-10 hours a week volunteering helping us coordinate ASI and its projects\nmin of 1 year experienced in virtual admin role\nteam player\ncomfortable to work virtually\nexperienced working with internet, Microsoft applications, google docs\nBachelor degree\nExcellent communication skills\"',NULL,NULL,NULL,NULL,NULL,NULL,'Y','A','2016-05-25 18:12:21','2016-07-30 07:31:36','https://cdn.pixabay.com/photo/2015/04/01/19/50/pixabay-702908__340.jpg');
INSERT INTO `project` (`id`,`organization_id`,`name`,`description`,`address1`,`address2`,`city`,`state`,`country`,`zip`,`remote_flag`,`status`,`created_time`,`updated_time`,`image_url`) VALUES (25,23,'Technical architecture lead volunteer','We need to organize the group of technical volunteers through a technical architect, a technical project planner, a technical product manager, and other skilled technical volunteers such as software developors for front and back end. We have multiple areas of our digital work that need to be taken up to the next level. We currently have forms but have not established email automations. We plug into some systems and not others as www.advancesocialinnovation.org shows. But we have established a baseline, We need to build tools that reflect processes we want our volunteers and social enterprises to go through.',NULL,NULL,NULL,NULL,NULL,NULL,'Y','A','2016-03-06 02:02:46','2016-11-04 14:15:07','https://cdn.pixabay.com/photo/2015/10/21/14/15/database-999740__340.jpg');
